import React, {Component} from 'react'
import './style.css'
import Moment from 'moment'
import ClearIcon from '@material-ui/icons/Clear';
import CreateIcon from '@material-ui/icons/Create';
import { Link } from 'react-router-dom'




export default class Publicacoes extends Component{
    render(){
        console.log(this.props.post);

        return(
            <div className="post">
                <div className="barra">
                <h3>{this.props.post.titulo}</h3> 
                <Link to="/Cadastro"><ClearIcon/></Link>
                <Link to="/Editar" params={{id: this.props.post.id}}><CreateIcon/></Link>
                </div>
                <div className="conteudo">
                    <div className="data">
                        <p>{Moment(this.props.post.data).format("DD/MM/YYYY hh:mm")}</p>
                    </div>

                    <div className="descricao">
                            <p>{this.props.post.conteudo}</p>
                    </div>
                </div>
            </div>
        );
    }
}
